import React from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';
import Header from "../Header";
import Middle from "../HomeBanner";
import DisplayBanner from '../DisplayBox';
import "./styles.css";
import Slider from "../Home";
import DisplayBox from '../DisplayBox';
import TestSpring from '../TestSpring';
import LeftGridMainBox from '../LeftGridMainBox';
import HomeBanner from "../HomeBanner";
import RightGridBoxTop from '../RightGridBoxTop';
import RightGridBoxBottom from '../RightGridBoxBottom';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    margin: 'auto'
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
    margin: 'auto'

  },
  header: {
    marginTop: '2%',
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
    margin: 'auto'
  },
  middle: {

  },
  display: {

  }
}));




export default function SimpleContainer() {

  const classes = useStyles();

  return (
    <React.Fragment>
      <CssBaseline />
      <Container maxWidth="false" >
        <Grid container spacing={3}>

          <Grid item xs={12} style={{ mariginTop: '20%' }}>
            <Paper className={classes.paper} className={classes.header} elevation={14}><Header /></Paper>
          </Grid>

          <Grid item xs={12} sm={6}>
            <Paper className={classes.paper} style={{ height: '100%' }}><HomeBanner /> </Paper>
          </Grid>
          <Grid item xs={12} sm={6}
            style={{ margin: 'auto' }}
          >
            <Paper className={classes.paper} elevation={14}><RightGridBoxTop/></Paper>
            <br></br>
            <Paper className={classes.paper} elevation={14}><RightGridBoxBottom/></Paper>
          </Grid>
          <Grid item xs={12}>
            <Paper
              className={classes.paper} className={classes.header}></Paper>
          </Grid>
        </Grid>
      </Container>
    </React.Fragment>
  );
}
